import React from 'react';
import { Stack,Container,Box } from '@mui/material';

export default function Home() {
  return (
  <Stack spacing={0} direction="column" alignItems="center">
      <Box sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'70%', alignI}}  >
        <h1>Hello World</h1>
      </Box>
      <h1>Hello World</h1>
  </Stack>
  );
}
